/********************************************************************
* FUNCTION y_ietf_interfaces_init2
* 
* SIL init phase 2: non-config data structures
* Called after running config is loaded
* 
* RETURNS:
*     error status
********************************************************************/
status_t y_ietf_interfaces_init2 (void)
{
    status_t res = NO_ERR;

    interfaces_val = agt_init_cache(
        y_ietf_interfaces_M_ietf_interfaces,
        y_ietf_interfaces_N_interfaces,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    interfaces_state_val = agt_init_cache(
        y_ietf_interfaces_M_ietf_interfaces,
        y_ietf_interfaces_N_interfaces_state,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    res = u_ietf_interfaces_init2();

    return res;
} /* y_ietf_interfaces_init2 */

